import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { ThemeProvider, createTheme, CssBaseline } from '@mui/material';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import { Link, useNavigate } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

import { AuthProvider } from './contexts/AuthContext';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import PetList from './pages/PetList';
import PetDetails from './pages/PetDetails';

const theme = createTheme({
  palette: {
    primary: {
      main: '#ff7043', // Vibrant orange
      contrastText: '#fff',
    },
    secondary: {
      main: '#29b6f6', // Bright blue
      contrastText: '#fff',
    },
    background: {
      default: '#fff8f0',
      paper: '#fff',
    },
  },
  typography: {
    fontFamily: 'Quicksand, Roboto, Arial',
    h3: { fontWeight: 700 },
    h4: { fontWeight: 700 },
    h5: { fontWeight: 600 },
  },
  shape: {
    borderRadius: 16,
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 24,
          textTransform: 'none',
          fontWeight: 600,
        },
      },
    },
  },
});

function MainAppBar() {
  const navigate = useNavigate();
  return (
    <AppBar position="static" color="primary" elevation={2}>
      <Toolbar>
        <Typography
          variant="h5"
          component={Link}
          to="/"
          sx={{ flexGrow: 1, color: 'inherit', textDecoration: 'none', fontWeight: 700 }}
        >
          🐾 Pet Share
        </Typography>
        <Button color="inherit" component={Link} to="/pets">Browse Pets</Button>
        <Button color="inherit" component={Link} to="/auth/login">Login</Button>
        <Button color="inherit" component={Link} to="/auth/register">Register</Button>
      </Toolbar>
    </AppBar>
  );
}

function Footer() {
  return (
    <Box sx={{ bgcolor: 'primary.main', color: 'primary.contrastText', py: 2, mt: 8, textAlign: 'center' }}>
      <Typography variant="body2">&copy; {new Date().getFullYear()} Pet Share. All rights reserved.</Typography>
    </Box>
  );
}
function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AuthProvider>
        <BrowserRouter>
          <MainAppBar />
          <Box sx={{ minHeight: '80vh' }}>
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/auth/login" element={<Login />} />
              <Route path="/auth/register" element={<Register />} />
              <Route path="/pets" element={<PetList />} />
              <Route path="/pets/:id" element={<PetDetails />} />
            </Routes>
          </Box>
          <Footer />
        </BrowserRouter>
        <ToastContainer position="bottom-right" />
      </AuthProvider>
    </ThemeProvider>
  );
}

export default App;
